document.addEventListener('turbolinks:load', function() {
  var controls = document.querySelectorAll('.form-inline-link');

  if (controls.length) {
    for (var i = 0; i < controls.length; i++) {
      controls[i].addEventListener('click', formInLineLinkHandler);
    }
  }

  var errors = document.querySelector('.resource-errors');

  if (errors) {
    var resourceId = errors.dataset.resourceId;
    formInlineHandler(resourceId);
  }
})

function formInLineLinkHandler(event) {  
  event.preventDefault();
  var testId = this.dataset.testId;
  formInlineHandler(testId);
}

function formInlineHandler(testId) {
  var link = document.querySelector('.form-inline-link[data-test-id="' + testId + '"]');
  var testTitle = document.querySelector('.test-title[data-test-id="' + testId + '"]');
  var formInLine = document.querySelector('.form-inline[data-test-id="' + testId + '"]');

  if (formInLine.classList.contains('hide')) {
    testTitle.classList.add('hide');
    formInLine.classList.remove('hide');
    link.textContent = I18n.t('.cancel');
  } else {
    testTitle.classList.remove('hide');
    formInLine.classList.add('hide');
    link.textContent = I18n.t('.edit');
  }
}
;
document.addEventListener('turbolinks:load', function() {
  var password = document.getElementById('user_password');
  var confirmation = document.getElementById('user_password_confirmation');

  if (confirmation) {
    confirmation.addEventListener("input", comparePasswords.bind(null, password, confirmation));
    confirmation.addEventListener("change", comparePasswords.bind(null, password, confirmation));
  }
})

function comparePasswords(password, confirmation) {
    if (confirmation.value == "") {
      return 0;
    }
    if (password.value == confirmation.value)
    {
      confirmation.className = "success";
    } else {
      confirmation.className = "error";
    }
}
;
document.addEventListener('turbolinks:load', function() {
  var control = document.querySelector('.sort-by-title');

  if (control) { control.addEventListener('click', sortRowsByTitle) };
})

function sortRowsByTitle() {
  var table = document.querySelector('table');

  /// NodeList
  var rows = table.querySelectorAll('tr');
  var sortedRows = [];

  /// select all table rows except the header
  for (var i = 1; i < rows.length; i++) {
    sortedRows.push(rows[i]);
  }

  if (this.querySelector('.octicon-arrow-up').classList.contains('hide')) {
    sortedRows.sort(compareRowsAsc);
    this.querySelector('.octicon-arrow-up').classList.remove('hide');
    this.querySelector('.octicon-arrow-down').classList.add('hide');
  } else {
    sortedRows.sort(compareRowsDesc);
    this.querySelector('.octicon-arrow-down').classList.remove('hide');
    this.querySelector('.octicon-arrow-up').classList.add('hide');
  }

  var sortedTable = document.createElement('table');

  sortedTable.classList.add('table');
  sortedTable.appendChild(rows[0]);

  for (var i = 0; i < sortedRows.length; i++) {
    sortedTable.appendChild(sortedRows[i]);
  }

  table.parentNode.replaceChild(sortedTable, table);
}

function compareRowsAsc(row1, row2) {
  var questionTitle1 = row1.querySelector('td').textContent;
  var questionTitle2 = row2.querySelector('td').textContent;

  if (questionTitle1 < questionTitle2) { return -1 };
  if (questionTitle1 > questionTitle2) { return 1 };
  return 0;
}

function compareRowsDesc(row1, row2) {
  var questionTitle1 = row1.querySelector('td').textContent;
  var questionTitle2 = row2.querySelector('td').textContent;

  if (questionTitle1 < questionTitle2) { return 1 };
  if (questionTitle1 > questionTitle2) { return -1 };
  return 0;
}
